import React, { Component } from 'react'

class Page extends Component {

    getComponent(){
        console.log("king");
    }

    render() {
        return (
            <div>
                <h1>Person Manager</h1>
                <h5>This is my task</h5>
                <button onClick = {this.getComponent.bind(this)} label="Action" >Click me</button>
            </div>
        )
    }
}

export default Page
